import React from 'react';

const HalfDayCell = ({ day, city, startHour, endHour, method }) => {  
  const showProgram = () => {
    switch (method) {
      case 'delivery':
        return <td className="delivery">{method}</td>
      case 'market':
        return <td><strong className="market-place">{city}</strong> <br/> {startHour} Ã  {endHour}</td> 
    }
  };

  return (
    <tr>
      <th>{day}</th>
      {showProgram()}
    </tr>
  );
};

export default HalfDayCell;
